import React from 'react';
import { Carousel } from 'react-bootstrap';

const AboutSlides = () => {
  return (
    <Carousel>
      <Carousel.Item>
        <h3>ABOUT US</h3>
        <p> The Link Road Residents Association was established in 2008/09 to address issues affecting residents within its area of jurisdiction. The association was formally registered with the Registrar of Societies in 2012, and the founder members were Jane W. Ngugi, David L Karanja, and Allan Ngugi. </p>
      </Carousel.Item>
      <Carousel.Item>
        <h3>OUR MISSION</h3>
        <p> The association set out to pursue its Road Development Agenda (Link Road E1507) and establish strategic relationships with government agencies, law enforcement agencies, and the private sector to maintain security, upkeep and maintenance of the road infrastructure, clean water supply, electrical power, refuse and garbage disposal, and transportation services. The association also focused on environmental activities and public utility land management.</p>
      </Carousel.Item>
      <Carousel.Item>
        <h3>Slide 3</h3>
        <p>Duis aute irure dolor in reprehenderit in voluptate velit esse cillum dolore eu fugiat nulla pariatur.</p>
      </Carousel.Item>
    </Carousel>
  );
};

export default AboutSlides;
